import React from  'react';
import ReactDOM from 'react-dom';
import Card from './Card';
import Source from './Source'



ReactDOM.render(
    <>
    <Card sname={Source[0].sname} pic={Source[0].imgsrc}></Card>
    <Card sname={Source[1].sname} pic={Source[1].imgsrc}></Card>
    <Card sname={Source[2].sname} pic={Source[2].imgsrc}></Card>
    <Card sname={Source[3].sname} pic={Source[3].imgsrc}></Card>  
    </>,
    document.getElementById("root")
)
